[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX nando: <http://nanbyodata.jp/ontology/nando#>
PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>

SELECT DISTINCT ?disease ?label ?hiragana ?altLabel
WHERE {
  ?disease a nando:NANDO_0000001 ;
           rdfs:label ?label .
  OPTIONAL { ?disease nando:hiragana_name ?hiragana }
  OPTIONAL { ?disease skos:altLabel ?altLabel }
  FILTER(CONTAINS(LCASE(STR(?label)), "parkinson") || 
         CONTAINS(LCASE(STR(?altLabel)), "parkinson") ||
         CONTAINS(STR(?label), "パーキンソン"))
}
LIMIT 10
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX nando: <http://nanbyodata.jp/ontology/nando#>

SELECT DISTINCT ?disease ?label ?hiragana
WHERE {
  ?disease rdfs:label ?label .
  OPTIONAL { ?disease nando:hiragana_name ?hiragana }
  FILTER(CONTAINS(STR(?label), "パーキンソン"))
}
LIMIT 20
"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "nando"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "
PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dct: <http://purl.org/dc/terms/>
PREFIX nando: <http://nanbyodata.jp/ontology/NANDO_>

SELECT ?disease ?identifier ?en_label ?ja_label ?ja_hira
FROM <http://nanbyodata.jp/ontology/nando>
WHERE {
  ?disease a owl:Class ;
           dct:identifier ?identifier ;
           rdfs:label ?en_label .
  OPTIONAL { ?disease rdfs:label ?ja_label . FILTER(LANG(?ja_label) = "ja") }
  OPTIONAL { ?disease rdfs:label ?ja_hira . FILTER(LANG(?ja_hira) = "ja-hira") }
  FILTER(LANG(?en_label) = "en")
  ?en_label bif:contains "'Parkinson*'" option (score ?sc) .
}
ORDER BY DESC(?sc)
LIMIT 10
"}}]

