[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "clinvar"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>

SELECT ?clinical_significance (COUNT(DISTINCT ?variant) as ?count)
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?variant a cvo:VariationArchiveType ;
           cvo:record_status "current" ;
           cvo:classified_record ?classrec .
  ?classrec cvo:classifications/cvo:germline_classification/cvo:description ?clinical_significance .
}
GROUP BY ?clinical_significance
ORDER BY DESC(?count)"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "clinvar", "sparql_query": "PREFIX cvo: <http://purl.jp/bio/10/clinvar/>

SELECT ?significance (COUNT(?variant) as ?count)
FROM <http://rdfportal.org/dataset/clinvar>
WHERE {
  ?variant a cvo:VariationArchiveType ;
           cvo:classified_record ?rec .
  ?rec cvo:classifications ?class .
  ?class cvo:germline_classification ?germ .
  ?germ cvo:description ?significance .
}
GROUP BY ?significance
ORDER BY DESC(?count)
LIMIT 50"}}]
